import { connect } from "react-redux"
import { NavLink, Link } from "react-router-dom"
import hongo_logo from "assets/images/mushroom.png"
import veggi_gif from "assets/images/vegetable.gif";
function Navbar() {
    return (
        <div className="w-full py-4 top 0 fixed">
            <div className="-ml-4 -mt-2 flex flex-wrap items-center justify-between sm:flex-nowrap md:px-12 px-2">
                <Link to='/' className="ml-4 mt-2"> <div className="w-full py-4 top 0 fixed"> 
                    Herba
                </div>
                    <img
                    src={hongo_logo}
                    width={33}
                    height={27}
                    className=""/>
                </Link>
                <div className="ml-4 mt-2 flex-shrink-0">
                    <NavLink to='/nosotros' className="text-lg inline-flex font-medium leading-6 underline-gray-900 hover:text-blue-500 border-b-2 border-white hover:border-blue-600 mx-6">Sobre Nosotros</NavLink>
                    <NavLink to='/platillos' className="text-lg inline-flex font-medium leading-6 underline-gray-900 hover:text-blue-500 border-b-2 border-white hover:border-blue-600 mx-6">Platillos</NavLink>
                    <NavLink to='/bebidas' className="text-lg inline-flex font-medium leading-6 underline-gray-900 hover:text-blue-500 border-b-2 border-white hover:border-blue-600 mx-6">Bebidas y Snacks</NavLink>
                    <button
                        type="button"
                        className="ml-12 relative inline-flex items-center rounded-md border border-transparent bg-blue-botton px-8 py-2 text-l font-bold text-white shadow-sm hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-900 focus:ring-offset-2"
                    >
                        Quiero Probarlo!
                        <img src={veggi_gif} className="w-6 h-6"/>
                        
                    </button>
                </div>
            </div>
        </div>
    )
}
